import { Redirect, Switch } from "react-router-dom";
import { Route } from "react-router-dom/cjs/react-router-dom.min";
import AllQuotes from "./pages/AllQuotes";

function App() {
  return (
    <div>
      <Switch>
        <Route path="/" exact>
          <Redirect to="/quotes"></Redirect>
        </Route>
        <Route path="/quotes">
          <AllQuotes />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
